import Qs from "qs";
export default {
  name: "taskInfo",
  components: {},
  props: {
    isShowDialog: Boolean,
    taskData: {
      type: String
    }
  },
  watch: {
    taskData: function taskData(newValue, oldValue) {
      if (newValue == "add") {
        this.look = false;
        this.textarea = "";
      } else {
        this.textarea = newValue;
        this.look = true;
      }
    }
  },
  data: function data() {
    return {
      textarea: "",
      type: ""
    };
  },
  computed: {
    getbalance: function getbalance() {
      var userinfo = this.$store.state.userinfo;
      return userinfo.balance;
    }
  },
  created: function created() {},
  mounted: function mounted() {},
  methods: {
    addNotice: function addNotice() {
      var _this = this;

      var param = {
        memo: this.textarea,
        type: this.type
      };
      this.axios.post(this.urls.addnotice + "?" + Qs.stringify(param)).then(function (response) {
        _this.handleClose();
      });
    },
    //dialog关闭按钮
    handleClose: function handleClose() {
      this.$emit("editDialog", false);
    }
  }
};
